import React from "react";
import { MoviesService } from "../api/MoviesService";

export const MovieInfo = (data) => {
  return (
    <>
      <div>
        <h1>{data.title}</h1>
        <h2>{data.tagline}</h2>
        <p>{data.overview}</p>
      </div>
    </>
  );
};
